import { Button } from '@/components/ui/button';
import {
  Dialog,
  DialogContent,
  DialogDescription,
  DialogFooter,
  DialogHeader,
  DialogTitle,
  DialogTrigger,
} from '@/components/ui/dialog'; // Prettier-ignore
import { type ComponentProps, useState, useEffect, useCallback } from 'react';
import FilesTable from './files-table';
import { PsciLoaderCircle, PsciLoader2 } from '@/components/icons/psci-icons';
import { exists } from '@/lib/type-guards';
import type { FileInfoView } from '@/db/file-info-view';

interface FilesTableDialogProps extends ComponentProps<typeof FilesTable> {
  trigger: React.ReactElement;
  startOpen?: boolean;
  open?: boolean;
  onOpenChange?: (open: boolean) => void;
  isFileToggleLoading?: boolean;
  onConfirmSelection?: (selectedFiles: FileInfoView[]) => Promise<void> | void;
}

export default function FilesTableDialog(
  props: Readonly<FilesTableDialogProps>
) {
  const [localOpen, setLocalOpen] = useState(props.startOpen || false);
  const [localSelectedItems, setLocalSelectedItems] = useState<FileInfoView[]>(
    props.initialSelection ?? []
  );
  const [isConfirming, setIsConfirming] = useState(false);

  const isControlled = exists(props.open) && exists(props.onOpenChange);
  const open = isControlled ? props.open : localOpen;
  const setOpen = isControlled ? props.onOpenChange : setLocalOpen;

  // Sync local state with controlled state
  useEffect(() => {
    if (isControlled) setLocalOpen(props.open || false);
  }, [isControlled, props.open]);

  // Reset local selection when dialog opens
  useEffect(() => {
    if (open) {
      setLocalSelectedItems(props.initialSelection ?? []);
      setIsConfirming(false);
    }
  }, [open, props.initialSelection]);

  // Handle local selection changes (no API calls)
  const handleLocalSelectionChange = useCallback(
    (selectedFiles: FileInfoView[]) => {
      setLocalSelectedItems(selectedFiles);
    },
    []
  );

  // Handle modal close without confirmation
  const handleOpenChange = useCallback(
    (newOpen: boolean) => {
      if (!newOpen && !isConfirming) {
        // Closing modal without confirmation - discard local changes
        setLocalSelectedItems(props.initialSelection ?? []);
      }
      setOpen(newOpen);
    },
    [setOpen, isConfirming, props.initialSelection]
  );

  const confirmSelection = async () => {
    setIsConfirming(true);
    try {
      if (props.onConfirmSelection) {
        await props.onConfirmSelection(localSelectedItems);
      } else if (props.onSelectionChange) {
        // Fallback for components that haven't been updated yet
        await props.onSelectionChange(localSelectedItems);
      }
      setOpen(false);
    } catch (error) {
      console.error('Error confirming selection:', error);
      // Don't close dialog on error so user can try again
    } finally {
      setIsConfirming(false);
    }
  };

  return (
    <Dialog open={open} onOpenChange={handleOpenChange}>
      <DialogTrigger asChild>{props.trigger}</DialogTrigger>
      <DialogContent className='min-w-[95vw] h-[85vh] flex flex-col z-[99]'>
        {isConfirming && (
          <div className='fixed inset-0 bg-background/80 backdrop-blur-sm z-[99999999] flex items-center justify-center'>
            <div className='flex items-center justify-center space-x-2'>
              <PsciLoaderCircle className='animate-spin w-full' size={45} />
            </div>
          </div>
        )}
        <DialogHeader className='bg-transparent'>
          <DialogTitle>Choose Files</DialogTitle>
          <DialogDescription>
            Your assistant will be able to reference these files when answering
            questions
          </DialogDescription>
        </DialogHeader>

        <div className='flex-1 min-h-0 overflow-hidden'>
          <FilesTable
            selectionHeaderClassName='bg-muted'
            showColumnVisibility={false}
            onSelectionChange={handleLocalSelectionChange}
            initialSelection={localSelectedItems}
            tableClassNames='max-h-[calc(100%_-_130px)]'
            tableBackground='bg-muted/50'
          />
        </div>

        <DialogFooter>
          <Button
            onClick={confirmSelection}
            disabled={isConfirming}
            className='flex gap-2 items-center'
          >
            {isConfirming ? (
              <>
                <PsciLoader2 size={16} className='animate-spin' />
                Confirming...
              </>
            ) : (
              'Confirm Selection'
            )}
          </Button>
        </DialogFooter>
      </DialogContent>
    </Dialog>
  );
}

