import { Button } from '@/components/ui/button';
import {
  Dialog,
  DialogContent,
  DialogDescription,
  DialogFooter,
  DialogHeader,
  DialogTitle,
} from '@/components/ui/dialog';
import {
  Select,
  SelectContent,
  SelectItem,
  SelectTrigger,
  SelectValue,
} from '@/components/ui/select';
import { Calendar } from '@/components/ui/calendar';
import {
  Popover,
  PopoverContent,
  PopoverTrigger,
} from '@/components/ui/popover';
import type { SelectOptionType, Task } from '@/types/task';
import { type Dispatch, type SetStateAction, useState } from 'react';
import { PsciLoaderCircle, PsciCalendar } from '@/components/icons/psci-icons';
import { formatDate } from '@/lib/utils';

type BulkUpdateModalsProps = {
  selectedTaskIds: Task['id'][];
  statusList: SelectOptionType[];
  priorityList: SelectOptionType[];
  onUpdate: (
    updates: Partial<Pick<Task, 'statusId' | 'priorityId' | 'dueDate'>>
  ) => Promise<void>;
  onDelete: () => Promise<void>;
  isLoading: boolean;
  showStatusModal: boolean;
  setShowStatusModal: Dispatch<SetStateAction<boolean>>;
  showPriorityModal: boolean;
  setShowPriorityModal: Dispatch<SetStateAction<boolean>>;
  showDueDateModal: boolean;
  setShowDueDateModal: Dispatch<SetStateAction<boolean>>;
  showDeleteModal: boolean;
  setShowDeleteModal: Dispatch<SetStateAction<boolean>>;
};

export const BulkUpdateModals = ({
  selectedTaskIds,
  statusList,
  priorityList,
  onUpdate,
  onDelete,
  isLoading,
  showStatusModal,
  setShowStatusModal,
  showPriorityModal,
  setShowPriorityModal,
  showDueDateModal,
  setShowDueDateModal,
  showDeleteModal,
  setShowDeleteModal,
}: BulkUpdateModalsProps) => {
  const [selectedStatus, setSelectedStatus] = useState<string>('');
  const [selectedPriority, setSelectedPriority] = useState<string>('');
  const [selectedDate, setSelectedDate] = useState<Date>();

  const handleDateChange = (date?: Date) => {
    setSelectedDate(date);
  };

  const handleStatusChange = async () => {
    if (!selectedStatus) return;
    await onUpdate({ statusId: selectedStatus });
    setShowStatusModal(false);
    setSelectedStatus('');
  };

  const handlePriorityChange = async () => {
    if (!selectedPriority) return;
    await onUpdate({ priorityId: selectedPriority });
    setShowPriorityModal(false);
    setSelectedPriority('');
  };

  const handleDueDateChange = async () => {
    if (!selectedDate) return;
    const formattedDate = formatDate(selectedDate);
